script({
	// The input ports of the Javascript node, name of input and type
	inputs:{
        objectId:'string',
        columns:'array'
	},
	outputs:{
	    cells:'array',
	},
	signals:{
		generate:function() {
		    let object = Noodl.Object.get(this.inputs.objectId);
		    let cells = Noodl.Array.get(this.inputs.objectId+"_cells");
		    cells.set({});
	        this.inputs.columns.each(col=>{
	            let key = col.get("key");
	            let value = object.get([key]);
	            let cell = Noodl.Model.get(this.inputs.objectId+"_cells_"+key);
		        cell.setAll({key:key,value:value});
		        cells.add(cell);
	        })

	        this.setOutputs({cells: cells});
            //object.set("cells",cells);
		}
	}
})

script({
	inputs:{
        columns:'array',
        key:'string'
	},
	outputs:{
	    mount:'boolean',
	},
	signals: {
	    checkColumns: function(){
	        this.check();
	    }
	},
	changed:{
		columns:function(value) {
		    this.check();
		}
	},
	methods:{
		check:function() {
		    let found = false;
		    this.inputs.columns.each(col =>{
		        if(col.get("key") === this.inputs.key) found = true;
		    })
		    this.setOutputs({mount:found});
		}
	}
})
